// GetStarted.js

import React from 'react';
import GoogleLoginButton from './GoogleLoginButton';

const GetStarted = () => {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-900">
      <div className="bg-white p-8 rounded shadow-md">
        <h1 className="text-3xl font-semibold mb-4">Welcome to ChatApp!</h1>
        <p className="text-lg mb-6 text-white">
          ChatApp is an amazing platform where you can connect and chat with your friends in real-time.
        </p>
        <div className="mb-8">
          <GoogleLoginButton />
        </div>
        <p className="text-sm text-gray-300">
          By signing in, you agree to our <a href="/" className="text-blue-500">Terms and Conditions</a>.
        </p>
      </div>
    </div>
  );
};

export default GetStarted;
